	public static void printStrList(ArrayList<String> strList)
	{
		for(String str: strList)
		{
			System.out.println(str);
		}
		System.out.println("");
	}
	public static int[][] convertToIntArray(ArrayList<String> strList)
	{
		int colCount = strList.get(0).length();
		int rowCount = strList.size();
		
		int[][] array = new int[colCount][rowCount];
		
		
		for(int j= 0 ;j<strList.size();j++)
		{
			String str = strList.get(j);
			for(int i= 0 ;i<colCount ;i++)
			{
				array[i][j] = str.charAt(i)=='X'?-1:0;
			}
		}
	
		return array;
		
	}
	
	public static ArrayList<String> convertToStrs(int[][] array)
	{
	
		ArrayList<String> strList = new ArrayList<String>();
		StringBuilder sb = new StringBuilder();
		for(int j = 0; j<array[0].length;j++)
		{
			for(int i = 0; i<array.length;i++)
			{

				if(array[i][j] == 2) sb.append("O");
				else sb.append("X");
			}
			strList.add(sb.toString());
			sb.setLength(0);
		}
	
		return strList;
		
	}
	public static void processArray(int[][] array)
	{
		int totalCol = array.length;
		int totalRow = array[0].length;
		
		for(int i =0 ;i<totalCol;i++)
		{
			updateCell(array,i, 0, totalCol, totalRow);
			updateCell(array,i, totalRow-1, totalCol, totalRow);
		}
		for(int j =0 ;j<totalRow;j++)
		{
			updateCell(array,0,j, totalCol, totalRow);
			updateCell(array,totalCol-1, j, totalCol, totalRow);
		}
	}
	public static void updateCell(int[][] array, int x, int y, int totalCol, int totalRow)
	{
		if(array[x][y]==-1)return;
		Queue<Integer> xIndexQue = new LinkedList<Integer>();
		Queue<Integer> yIndexQue = new LinkedList<Integer>();
		
	    xIndexQue.offer(x);
		yIndexQue.offer(y);
		
		int curX = x;
		int curY = y;
		array[curX][curY] = 2;
		while(!xIndexQue.isEmpty()){
			curX = xIndexQue.poll();
			curY = yIndexQue.poll();
			if(curX-1>=0 && array[curX-1][curY] == 0)
			{
				array[curX-1][curY] = 2;
				xIndexQue.offer(curX-1);
				yIndexQue.offer(curY);
			}
			if(curX+1<totalCol && array[curX+1][curY] == 0)
			{
				array[curX+1][curY] = 2;
				xIndexQue.offer(curX+1);
				yIndexQue.offer(curY);
			}
			if(curY-1>=0 && array[curX][curY-1] == 0)
			{
				array[curX][curY-1] = 2;
				xIndexQue.offer(curX);
				yIndexQue.offer(curY-1);
			}
			if(curY+1<totalRow && array[curX][curY+1] == 0)
			{
				array[curX][curY+1] = 2;
				xIndexQue.offer(curX);
				yIndexQue.offer(curY+1);
			}
		}
				
	
         
	}
